import React from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";
import {
  selectCurrentUser,
  selectOnEdit,
} from "../../redux/user/user.selector";
import CusButton from "../../component/cus-button/cus-button.component";
import OnEdite from "../../component/onEdite/onEdite.component";
import "./profile.style.scss";

const Profile = ({ currentUser, edit, onEdite }) => {
  const { email, displayName } = currentUser;
  return (
    <div>
      <div>{edit ? <div>hello</div> : <div>hi</div>}</div>
      <button onClick={() => onEdite}>press </button>
    </div>
  );
};

const mapStateToProps = createStructuredSelector({
  currentUser: selectCurrentUser,
  edit: selectOnEdit,
});
const mapDispatchToProps = (dispatch) => ({
  onEdite: () => dispatch(onEdite()),
});
export default connect(mapStateToProps, mapDispatchToProps)(Profile);
